import { Component, OnInit, ViewChild, ElementRef} from '@angular/core';
import {SkyboardService} from "../../shared/modules/skyboard/skyboard.service";
import {CommonService} from "../../shared/services/common-service";
import { Router, NavigationEnd } from '@angular/router';
import { TranslateService } from '@ngx-translate/core';

import * as paper from 'paper';

@Component({
  selector: 'app-challenge-you',
  providers: [SkyboardService, CommonService, TranslateService],
  templateUrl: './challenge-you.component.html',
  styleUrls: ['./challenge-you.component.scss']
})
export class ChallengeYouComponent implements OnInit {
  advancedPagination: number;
  public challengeCards: Array<any> = [];
  profileSrc = '../../../assets/icons/ia5_vf.png';
  countOfChallenges: number;
  countOfSubmissions: number;
  countOfSubmittedAnswers: number;

  constructor(
    private translate: TranslateService,
    private skyboardService: SkyboardService,
    public cs: CommonService,
    private router: Router
  ) {
    this.advancedPagination = 1;
    this.challengeCards.push({
      _id: 'testing',
      _v: '',
      ownerId: '5a11ba5d02e3390bccfd1e63',
      ownerName: 'Leo Yeung',
      paperVersion: 1.1,
      questionName: '評估能力挑戰',
      topic: '小三綜合',
      subTopic: '綜合',
      difficulty: 4,
      blurLevel: 5,
      tags: ['加數','Preposition','重組句子'],
      thumbnail: 'data:image/png;base64,',
      viewNum: 0,
      rating: 0,
      submissionNum: 0,
      tCreate: new Date('11/20/2017 10:00 AM'),
      tLastUpdate: new Date('11/20/2017 10:00 AM'),
    });
    this.countOfChallenges = 0;
    this.countOfSubmissions = 0;
    this.countOfSubmittedAnswers = 0;
  }

  ngOnInit() {
    // scroll to top if leaving this page
    this.router.events.subscribe((evt) => {
      if (!(evt instanceof NavigationEnd)) {
        return;
      }
      window.scrollTo(0, 0)
    });

    try {
      const token = this.cs.localStorageItem('jwttoken');
      this.skyboardService.getAllChallengeQuestions(token).then((result) => {
        if (result['success']) {
          this.challengeCards = result['msg'];
          this.countOfChallenges = result['countOfChallengeQuestions'];
          this.countOfSubmissions = result['countOfSubmissions']; // including do revision
          this.countOfSubmittedAnswers = result['countOfSubmittedAnswers'];
        }
      }, (err) => {
        // show error why cannot register
        console.log(err);
      });
    } catch (ex) {
      console.error(ex);
    }
  }
}
